items.text:
Set to `false` to prevent any converters from being called on fields specified in
a {@link Ext.data.Model#method!set Ext.data.Model#set} operation.

**Note:** Setting the config to `false` will only prevent the convert / calculate
call when the set `fieldName` param matches the field's `{@link #name}`.  In the
following example the calls to set `salary` will not execute the convert method
on `{@link #method!set set}` while the calls to set `vested` will execute the convert method on the
initial read as well as on `{@link #method!set set}`.

Example model definition:

    Ext.define('MyApp.model.Employee', {
        extend: 'Ext.data.Model',
        fields: ['yearsOfService', {
            name: 'salary',
            convert: function (val) {
                var startingBonus = val * .1;
                return val + startingBonus;
            }
        }, {
            name: 'vested',
            convert: function (val, record) {
                return record.get('yearsOfService') >= 4;
            },
            depends: 'yearsOfService'
        }],
        convertOnSet: false
    });

    var tina = Ext.create('MyApp.model.Employee', {
        salary: 50000,
        yearsOfService: 3
    });

    console.log(tina.get('salary')); // logs 55000
    console.log(tina.get('vested')); // logs false

    tina.set({
        salary: 60000,
        yearsOfService: 4
    });
    console.log(tina.get('salary')); // logs 60000
    console.log(tina.get('vested')); // logs true

An Array of `{@link Ext.data.field.Field}` config objects, simply the field
{@link Ext.data.field.Field#cfg!name Ext.data.field.Field#name}, or a mix of config objects and strings.
If just a name is given, the field type defaults to `auto`.

In a {@link Ext.data.field.Field} config object you may pass the alias of
the `Ext.data.field.*` type using the `type` config option.

    // two fields are set:
    // - an 'auto' field with a name of 'firstName'
    // - and an Ext.data.field.Integer field with a name of 'age'
    fields: ['firstName', {
        type: 'int',
        name: 'age'
    }]

Fields will automatically be created at read time for any for any keys in the
data passed to the Model's {@link #cfg!proxy #proxy}
{@link Ext.data.reader.Reader} whose name is not explicitly configured in
the `fields` config.

Extending a Model class will inherit all the `fields` from the superclass /
ancestor classes.

The id generator to use for this model. The `{@link #cfg!identifier identifier}` generates values for the
{@link #cfg!idProperty #idProperty} when no value is given. Records with client-side generated
values for {@link #cfg!idProperty #idProperty} are called {@link #property!phantom #phantom} records since they are
not yet known to the server.

This can be overridden at the model level to provide a custom generator for a model.
The simplest form of this would be:

     Ext.define('MyApp.data.MyModel', {
         extend: 'Ext.data.Model',
         requires: ['Ext.data.identifier.Sequential'],
         identifier: 'sequential',
         ...
     });

The above would generate {@link Ext.data.identifier.Sequential} id's such
as 1, 2, 3 etc..

Another useful id generator is {@link Ext.data.identifier.Uuid}:

     Ext.define('MyApp.data.MyModel', {
         extend: 'Ext.data.Model',
         requires: ['Ext.data.identifier.Uuid'],
         identifier: 'uuid',
         ...
     });

An id generator can also be further configured:

     Ext.define('MyApp.data.MyModel', {
         extend: 'Ext.data.Model',
         identifier: {
             type: 'sequential',
             seed: 1000,
             prefix: 'ID_'
         }
     });

The above would generate id's such as ID_1000, ID_1001, ID_1002 etc..

If multiple models share an id space, a single generator can be shared:

     Ext.define('MyApp.data.MyModelX', {
         extend: 'Ext.data.Model',
         identifier: {
             type: 'sequential',
             id: 'xy'
         }
     });

     Ext.define('MyApp.data.MyModelY', {
         extend: 'Ext.data.Model',
         identifier: {
             type: 'sequential',
             id: 'xy'
         }
     });

For more complex, shared id generators, a custom generator is the best approach.
See {@link Ext.data.identifier.Generator} for details on creating custom id generators.

The name of the field treated as this Model's unique id.

If changing the idProperty in a subclass, the generated id field will replace the one
generated by the superclass, for example;

     Ext.define('Super', {
         extend: 'Ext.data.Model',
         fields: ['name']
     });

     Ext.define('Sub', {
         extend: 'Super',
         idProperty: 'customId'
     });

     var fields = Super.getFields();
     // Has 2 fields, "name" & "id"
     console.log(fields[0].name, fields[1].name, fields.length);

     fields = Sub.getFields();
     // Has 2 fields, "name" & "customId", "id" is replaced
     console.log(fields[0].name, fields[1].name, fields.length);

The data values for this field must be unique or there will be id value collisions
in the {@link Ext.data.Store}.

Call the "parent" method of the current method. That is the method previously
overridden by derivation or by an override (see {@link Ext#method!define Ext#define}).

     Ext.define('My.Base', {
         constructor: function (x) {
             this.x = x;
         },

         statics: {
             method: function (x) {
                 return x;
             }
         }
     });

     Ext.define('My.Derived', {
         extend: 'My.Base',

         constructor: function () {
             this.callParent([21]);
         }
     });

     var obj = new My.Derived();

     alert(obj.x);  // alerts 21

This can be used with an override as follows:

     Ext.define('My.DerivedOverride', {
         override: 'My.Derived',

         constructor: function (x) {
             this.callParent([x*2]); // calls original My.Derived constructor
         }
     });

     var obj = new My.Derived();

     alert(obj.x);  // now alerts 42

This also works with static and private methods.

     Ext.define('My.Derived2', {
         extend: 'My.Base',

         // privates: {
         statics: {
             method: function (x) {
                 return this.callParent([x*2]); // calls My.Base.method
             }
         }
     });

     alert(My.Base.method(10));     // alerts 10
     alert(My.Derived2.method(10)); // alerts 20

Lastly, it also works with overridden static methods.

     Ext.define('My.Derived2Override', {
         override: 'My.Derived2',

         // privates: {
         statics: {
             method: function (x) {
                 return this.callParent([x*2]); // calls My.Derived2.method
             }
         }
     });

     alert(My.Derived2.method(10); // now alerts 40

To override a method and replace it and also call the superclass method, use
{@link #method!callSuper #method-callSuper}. This is often done to patch a method to fix a bug.

This method is used by an **override** to call the superclass method but
bypass any overridden method. This is often done to "patch" a method that
contains a bug but for whatever reason cannot be fixed directly.

Consider:

     Ext.define('Ext.some.Class', {
         method: function () {
             console.log('Good');
         }
     });

     Ext.define('Ext.some.DerivedClass', {
         extend: 'Ext.some.Class',

         method: function () {
             console.log('Bad');

             // ... logic but with a bug ...

             this.callParent();
         }
     });

To patch the bug in `Ext.some.DerivedClass.method`, the typical solution is to create an
override:

     Ext.define('App.patches.DerivedClass', {
         override: 'Ext.some.DerivedClass',

         method: function () {
             console.log('Fixed');

             // ... logic but with bug fixed ...

             this.callSuper();
         }
     });

The patch method cannot use {@link #method!callParent #method-callParent} to call the superclass
`method` since that would call the overridden method containing the bug. In
other words, the above patch would only produce "Fixed" then "Good" in the
console log, whereas, using `callParent` would produce "Fixed" then "Bad"
then "Good".

